import React from "react";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="p-8 max-w-3xl mx-auto text-center space-y-6">
      <h1 className="text-4xl font-bold">Fred Hyeonuk Nam</h1>
      <p className="text-lg text-gray-600">Researcher, Musician, Guitar Maker</p>
      <div className="grid grid-cols-2 sm:grid-cols-4 gap-4 justify-center">
        <Link to="/about" className="bg-white/70 backdrop-blur-sm p-3 rounded-md shadow hover:bg-indigo-100 transition">About</Link>
        <Link to="/research" className="bg-white/70 backdrop-blur-sm p-3 rounded-md shadow hover:bg-indigo-100 transition">Research</Link>
        <Link to="/music" className="bg-white/70 backdrop-blur-sm p-3 rounded-md shadow hover:bg-indigo-100 transition">Music</Link>
        <Link to="/guitars" className="bg-white/70 backdrop-blur-sm p-3 rounded-md shadow hover:bg-indigo-100 transition">Guitars</Link>
      </div>
    </div>
  );
}
